import React, { useState } from 'react';
import { motion } from 'framer-motion';
import { FaCar, FaSprayCan, FaBroom, FaShieldAlt } from 'react-icons/fa';
import Navbar from './Navbar';

const AboutPage = () => {
  const [activeFeature, setActiveFeature] = useState(0);

  const features = [
    { title: "Full Detailing", icon: <FaCar />, description: "Comprehensive interior and exterior detailing for a showroom-fresh look." },
    { title: "Exterior Washing", icon: <FaSprayCan />, description: "Gentle yet thorough exterior cleaning to protect your vehicle's paint." },
    { title: "Interior Cleaning", icon: <FaBroom />, description: "Deep cleaning of all interior surfaces, leaving your car fresh and pristine." },
    { title: "Paint Protection", icon: <FaShieldAlt />, description: "Advanced ceramic coating to shield your car's paint from environmental damage." },
  ];

  return (
    <div className="bg-gray-100 text-gray-900 min-h-screen">
      <Navbar />
      <main className="pt-16 flex flex-col md:flex-row">
        <motion.div 
          initial={{ opacity: 0, x: -50 }}
          animate={{ opacity: 1, x: 0 }}
          transition={{ duration: 0.5 }}
          className="w-full md:w-1/2 p-8 flex flex-col justify-between"
        >
          <div>
            <h2 className="text-6xl font-light mb-2">A Car of Concepts</h2>
            <p className="text-xl mb-4">Elevate your driving experience</p>
            <motion.button
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
              className="bg-gray-900 text-white px-8 py-3 rounded-full text-sm font-semibold uppercase tracking-wide"
            >
              View Services
            </motion.button>
          </div>

          <div className="mt-8">
            <div className="flex justify-between mb-4">
              {features.map((feature, index) => (
                <motion.div
                  key={index}
                  className={`text-center cursor-pointer ${index === activeFeature ? 'text-gray-900' : 'text-gray-500'}`}
                  whileHover={{ scale: 1.1 }}
                  onClick={() => setActiveFeature(index)}
                >
                  <div className="text-3xl mb-2">{feature.icon}</div>
                  <p className="text-xs uppercase">{feature.title}</p>
                </motion.div>
              ))}
            </div>
            <motion.p
              key={activeFeature}
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.3 }}
              className="text-sm"
            >
              {features[activeFeature].description}
            </motion.p>
          </div>
        </motion.div>

        <motion.div 
          initial={{ opacity: 0, x: 50 }}
          animate={{ opacity: 1, x: 0 }}
          transition={{ duration: 0.5 }}
          className="w-full md:w-1/2 relative"
        >
          <img
            src="/path-to-your-car-image.jpg"
            alt="Luxury concept car"
            className="w-full h-full object-cover"
          />
          <div className="absolute inset-0 bg-black bg-opacity-30" />
          <div className="absolute top-1/2 left-1/2 transform -translate-x-1/2 -translate-y-1/2 text-white text-center">
            <h3 className="text-4xl font-light mb-4">Taillight</h3>
            <p className="text-sm">Innovative design meets functionality</p>
          </div>
          <div className="absolute bottom-8 left-8 right-8">
            <div className="grid grid-cols-3 gap-4">
              <Stat label="HP" value="384" />
              <Stat label="kW" value="287" />
              <Stat label="0-100" value="3.7s" />
            </div>
          </div>
        </motion.div>
      </main>
    </div>
  );
};

const Stat = ({ label, value }) => (
  <div className="text-white text-center">
    <p className="text-3xl font-bold">{value}</p>
    <p className="text-xs uppercase">{label}</p>
  </div>
);

export default AboutPage;
